import React, { useState } from 'react';

function WeatherPredictor() {
  const [inputs, setInputs] = useState({
    summary: '',
    precipType: '',
    apparentTemperature: '',
    humidity: '',
    windSpeed: '',
    windBearing: '',
    visibility: '',
    pressure: '',
  });
  const [temperature, setTemperature] = useState(null);

  // Options for the Summary dropdown
  const summaryOptions = [
    'Partly Cloudy',
    'Mostly Cloudy',
    'Overcast',
    'Foggy',
    'Breezy and Mostly Cloudy',
    'Clear',
    'Breezy and Partly Cloudy',
    'Breezy and Overcast',
    'Humid and Mostly Cloudy',
    'Humid and Partly Cloudy',
    'Windy and Foggy',
    'Windy and Overcast',
    'Breezy and Foggy',
    'Windy and Partly Cloudy',
    'Breezy',
    'Dry and Partly Cloudy',
    'Windy and Mostly Cloudy',
    'Dangerously Windy and Partly Cloudy',
    'Dry',
    'Windy',
    'Humid and Overcast',
    'Light Rain',
    'Drizzle',
    'Windy and Dry',
    'Dry and Mostly Cloudy',
    'Breezy and Dry',
    'Rain',
  ];

  // Options for the Precip Type dropdown
  const precipTypeOptions = ['Rain', 'Snow'];

  const handleChange = (e) => {
    setInputs({ ...inputs, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Send data to backend for prediction
    const response = await fetch('http://localhost:5000/predict', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(inputs),
    });

    const data = await response.json();
    setTemperature(data.predicted_temperature);
  };

  return (
    <div>
      <h1>Weather Predictor</h1>
      <form onSubmit={handleSubmit}>
        {/* Dropdown for Summary */}
        <label>
          Summary:
          <select name="summary" value={inputs.summary} onChange={handleChange} required>
            <option value="">Select a Summary</option>
            {summaryOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </label>
        <br />

        {/* Dropdown for Precip Type */}
        <label>
          Precip Type:
          <select name="precipType" value={inputs.precipType} onChange={handleChange} required>
            <option value="">Select Precip Type</option>
            {precipTypeOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </label>
        <br />

        {/* Other Inputs */}
        <label>
          Apparent Temperature (C):
          <input
            type="number"
            name="apparentTemperature"
            value={inputs.apparentTemperature}
            onChange={handleChange}
            placeholder="Enter Apparent Temperature"
            required
          />
        </label>
        <br />
        <label>
          Humidity:
          <input
            type="number"
            step="0.01"
            name="humidity"
            value={inputs.humidity}
            onChange={handleChange}
            placeholder="Enter Humidity"
            required
          />
        </label>
        <br />
        <label>
          Wind Speed (km/h):
          <input
            type="number"
            name="windSpeed"
            value={inputs.windSpeed}
            onChange={handleChange}
            placeholder="Enter Wind Speed"
            required
          />
        </label>
        <br />
        <label>
          Wind Bearing (degrees):
          <input
            type="number"
            name="windBearing"
            value={inputs.windBearing}
            onChange={handleChange}
            placeholder="Enter Wind Bearing"
            required
          />
        </label>
        <br />
        <label>
          Visibility (km):
          <input
            type="number"
            name="visibility"
            value={inputs.visibility}
            onChange={handleChange}
            placeholder="Enter Visibility"
            required
          />
        </label>
        <br />
        <label>
          Pressure (millibars):
          <input
            type="number"
            name="pressure"
            value={inputs.pressure}
            onChange={handleChange}
            placeholder="Enter Pressure"
            required
          />
        </label>
        <br />

        <button type="submit">Predict Temperature</button>
      </form>

      {/* Display the predicted temperature */}
      {temperature && <h2>Predicted Temperature: {temperature} °C</h2>}
    </div>
  );
}

export default WeatherPredictor;
